INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3046920029681', 'Lindt Excellence Doux 85%', '.NDT& SPRÜNGLI CHOCOLATIER SUISSE DEPUIS 1845 ein offenbart EXCELLENCE Mild 85% cacaointensives Geschmackser/ebnis für alle, die es gerne mi/der môgen — weniger cacao-sâuerlich und besonders milden Ede/cacaosorten und durch einen langen Conchierprozess entsteht ein vollmundiges und zug/eich angenehm mi/des Geschmacksprofil mit einem Hauch echter Bourbon-Vanil/e. Aufgrund der extra dünnen Tafe/form entfaltet Sich der auBergewôhnlich lang anha/tende Geschmack optimal. Die Maîtres Chocolatiers von Lindt stehen seit über 170 Jahren für hôchste Confiserie-Kunst. Unverg/eich/ich zart ist der feine Schmelz aller Lindt Chocolade-Spezialitâten, der auf die Erfindung der Conche durch Rodolphe Lindt im Jahre 1879 zurückgeht und den Weltruhm des Hauses Lindt & Sprüng/i bis heute begründet. Milde Edelbitter-Schokolade Kakao: 85% mindestens Zutaten: Kakaomasse, Kakaobutter, fettarmes Kakaopulver, Rohrohrzucker, Vanille. Kann Haselnüsse und andere Schalenfrüchte, Milch, Soja enthalten. NÂHRWERTINFORMATION PRO 100g:', 'https://static.openfoodfacts.org/images/products/304/692/002/9681/front_en.6.400.jpg', '55', '33', '19', '14', '', '8.9', '0.08', '0.031496062992126', '', '0');

